SELECT min(kt.kind) AS movie_kind, min(t.title) AS complete_us_internet_movie
FROM complete_cast AS cc, comp_cast_type AS cct1, company_name AS cn, company_type AS ct, info_type AS it1, keyword AS k, kind_type AS kt, movie_companies AS mc, movie_info AS mi, movie_keyword AS mk, title AS t
WHERE kt.id = t.kind_id AND t.id = mi.movie_id AND t.id = mk.movie_id AND t.id = mc.movie_id AND t.id = cc.movie_id AND mk.movie_id = mi.movie_id AND mk.movie_id = mc.movie_id AND mk.movie_id = cc.movie_id AND mi.movie_id = mc.movie_id AND mi.movie_id = cc.movie_id AND mc.movie_id = cc.movie_id AND k.id = mk.keyword_id AND it1.id = mi.info_type_id AND cn.id = mc.company_id AND ct.id = mc.company_type_id AND cct1.id = cc.status_id
AND mi.info IN ('$198,535 (USA) (5 December 1999)', '$33,000,000 (USA) (11 November 2012)', 'A webseries about dating disasters!', 'Baque, Agripino. "Tacio". (NP)', 'Director Ted W. Crestview takes four scintillating Seduction Cinema sinners, then proceeds to get them to confess and undress at the drop of a "tell me all about it" from sexy shrink Katie. Ruby digs Darian, Darian desires Kelli, and Kelli wants them all, Dr. Katie included, and when the smoke clears, you can bet this quartet of sexually charged young women has set psychiatry back about 100 years!', 'Japan:March 1994', 'SYNC: The Turkish shotgun makes the sound of a pump-action shotgun, despite the fact that it is a double-barreled, break-action gun.', 'What could a classified ad, a coal shed, a threesome and a waiter have to do with finding your dream man?', '[Freddy is playing pinball with Jason, suddenly Jason hits the ceiling and falls straight down]::Freddy Krueger: Tilt!') AND mc.company_id > 44388 AND k.id > 91558;